const bubble = (pic: string, name: string, points: string[], idx: number) => {
  const direction = idx % 2 === 0 ? "row" : "row-reverse";
  const paddingRight = idx % 2 === 0 ? "0%" : "68%";
  const paddingLeft = idx % 2 === 0 ? "68%" : "0%";
  return (
    <div className={styles.bubble}>
      <Image
        className={styles.icon}
        src={pic}
        alt={name}
        fill
        style={{ objectFit: "contain" }}
      ></Image>
      <div className={styles.lineRow} style={{ flexDirection: direction }}>
        <div className={styles.text}>
          <ul style={{ paddingLeft: paddingLeft, paddingRight: paddingRight }}>
            {points.map((m, idx) => (
              <li key={idx}>{m}</li>
            ))}
          </ul>
        </div>
        {idx > 0 && (
          <Image
            className={styles.line}
            src="/academy/line.svg"
            alt=""
            width="30"
            height="100"
          ></Image>
        )}
        <div className={styles.space}> </div>
      </div>
    </div>
  );
};

